document.onkeydown = function (e) {
    e = e || window.event;
    if (e.keyCode == 27) {   // on escape buttom
        if ($('.Menu').hasClass('open')) {
            $('.Menu').removeClass('open');
        }

        closeFilterDropdown();

        closeNewsletterPop();

        if ($('.searchPop').hasClass('open')) {
            closeSearchPopup();
        }
        if ($('.videoPopup').hasClass('open')) {
            closeVideoPopup();
        }
        if ($('.authorPopup').hasClass('open')) {
            closeAuthorPopup();
        }
    }
}


